import { Input } from "antd";
import React from "react";

const LoginForm = () => {
  return (
    <Form>
      <div>
        <label htmlFor='user-id'>ID</label>
        <br />
        <Input name='user-id' />
      </div>
      <div></div>
      <div></div>
    </Form>
  );
};

export default LoginForm;
